import React from 'react';
import profileImage from '../assets/p1.jpg'; 

const Header = () => {
  return (
    <div className="max-w-sm mx-auto bg-white shadow-xl rounded-lg overflow-hidden mt-8 fade-in transform transition duration-500 hover:scale-105">
     {/* Profile Image */}
       <div className="bg-gradient-to-r from-teal-500 to-blue-500 p-4">
        <img 
         src={profileImage} 
         alt="Profile" 
         className="w-24 h-24 rounded-full mx-auto border-4 border-gray-900" 
       />
      </div>

      {/* Name */}
      <div className="text-center mt-4">
        <h1 className="text-3xl font-bold text-gray-900">Sakthi Kousik R</h1>
        <p className="text-gray-500 italic">"Crafting digital dreams into reality"</p>
      </div>

      {/* Call-to-Action */}
      <div className="text-center mt-4">
        <a href="#contact" className="bg-teal-500 text-white px-6 py-3 rounded-full hover:bg-teal-600 transition duration-300 ease-in-out">Get in Touch</a>
      </div>

      {/* About Us Section */}
      <div id="about" className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">About Me</h2>
        <p className="mt-4 text-gray-700">I am a passionate web developer with over 5 years of experience in creating visually stunning and user-friendly websites. My goal is to deliver high-quality work while ensuring client satisfaction.</p>
      </div>

      {/* Social Media Links */}
      <div className="flex justify-center space-x-6 mt-4">
        <a href="#" className="text-blue-500 hover:text-blue-400 transition transform hover:scale-110">
          <i className="fab fa-facebook fa-2x"></i>
        </a>
        <a href="#" className="text-blue-400 hover:text-blue-300 transition transform hover:scale-110">
          <i className="fab fa-twitter-square fa-2x"></i>
        </a>
        <a href="#" className="text-pink-500 hover:text-pink-400 transition transform hover:scale-110">
          <i className="fab fa-instagram fa-2x"></i>
        </a>
        <a href="#" className="text-gray-400 hover:text-gray-300 transition transform hover:scale-110">
          <i className="fab fa-github fa-2x"></i>
        </a>
      </div>

      {/* Services Section */}
      <div id="services" className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">Services</h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 gap-6 mt-6">
          {/* Service 1 */}
          <div className="bg-white shadow-lg rounded-lg p-6 transform transition hover:scale-105">
            <h3 className="text-lg font-semibold text-gray-900">Web Development</h3>
            <p className="mt-2 text-gray-600">websites tailored to your business needs.</p>
          </div>
          {/* Service 2 */}
          <div className="bg-white shadow-lg rounded-lg p-6 transform transition hover:scale-105">
            <h3 className="text-lg font-semibold text-gray-900">UI/UX Design</h3>
            <p className="mt-2 text-gray-600"> enhance user experience and retention.</p>
          </div>
          {/* Service 3 */}
          <div className="bg-white shadow-lg rounded-lg p-6 transform transition hover:scale-105">
            <h3 className="text-lg font-semibold text-gray-900">SEO Optimization</h3>
            <p className="mt-2 text-gray-600">ranking and driving more organic traffic.</p>
          </div>
          {/* Service 4 */}
          <div className="bg-white shadow-lg rounded-lg p-6 transform transition hover:scale-105">
            <h3 className="text-lg font-semibold text-gray-900">E-Commerce Solutions</h3>
            <p className="mt-2 text-gray-600"> online stores to grow your business.</p>
          </div>
        </div>
      </div>

      {/* Image Gallery Section */}
      <div id="gallery" className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">Gallery</h2>
        <div className="flex space-x-4 mt-4">
          <div className="rounded-lg overflow-hidden shadow-lg">
            <img src="https://via.placeholder.com/800x500" alt="Gallery 1" className="w-full h-64 object-cover transform transition-all duration-500 hover:scale-105" />
          </div>
          <div className="rounded-lg overflow-hidden shadow-lg">
            <img src="https://via.placeholder.com/800x500" alt="Gallery 2" className="w-full h-64 object-cover transform transition-all duration-500 hover:scale-105" />
          </div>
          <div className="rounded-lg overflow-hidden shadow-lg">
            <img src="https://via.placeholder.com/800x500" alt="Gallery 3" className="w-full h-64 object-cover transform transition-all duration-500 hover:scale-105" />
          </div>
          <div className="rounded-lg overflow-hidden shadow-lg">
            <img src="https://via.placeholder.com/800x500" alt="Gallery 4" className="w-full h-64 object-cover transform transition-all duration-500 hover:scale-105" />
          </div>
        </div>

        {/* Navigation Button Below Carousel */}
        <div className="text-center mt-4">
          <button className="bg-teal-500 text-white px-6 py-2 rounded-full hover:bg-teal-600 transition duration-300 ease-in-out">
            Next Slide
          </button>
        </div>
      </div>

      {/* Product Section */}
      <div id="products" className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">Our Products</h2>

        {/* Product 1 */}
        <div className="product-card">
          <h3 className="product-title">Web Development Course</h3>
          <p className="text-gray-600">A comprehensive guide to mastering web development with hands-on projects and real-world applications.</p>
          <p className="product-price">$49.99</p>
        </div>

        {/* Product 2 */}
        <div className="product-card mt-4">
          <h3 className="product-title">Graphic Design Toolkit</h3>
          <p className="text-gray-600">A collection of essential tools and templates for graphic designers, including icons, fonts, and more.</p>
          <p className="product-price">$29.99</p>
        </div>

        {/* Product 3 */}
        <div className="product-card mt-4">
          <h3 className="product-title">Photography E-book</h3>
          <p className="text-gray-600">An in-depth guide on photography techniques, lighting, and editing, perfect for beginners and pros alike.</p>
          <p className="product-price">$19.99</p>
        </div>
      </div>

      {/* Contact Section */}
      <div id="contact" className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">Contact</h2>
        <p className="mt-4 text-gray-700">Phone: <a href="tel:+1234567890" className="text-teal-500 hover:underline">+123 456 7890</a></p>
        <p className="mt-4 text-gray-700">Email: <a href="mailto:john.doe@example.com" className="text-teal-500 hover:underline">john.doe@example.com</a></p>
      </div>

      {/* Address and Map */}
      <div className="p-6 mt-4">
        <h2 className="text-xl font-semibold text-teal-400 border-b-2 border-teal-500 pb-2">Address</h2>
        <p className="mt-4 text-gray-700">123 Main Street, Cityville, Country</p>
        <iframe
          src="https://www.google.com/maps/embed?pb=..."
          width="100%" height="200" style={{ border: 0 }} allowFullScreen=""
          loading="lazy" className="rounded-md shadow-lg"
        ></iframe>
      </div>


    </div>
  );
}

export default Header;


